	add("frecency", "{\"term\":\"frecency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|frequency|recency|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any heuristic measure that combines the frequency and recency of visits to a given URI, used by some web browsers to rank URIs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 February 13, Mark Raby, “[http://www.tgdaily.com/content/view/36048/140/ Firefox 3 Beta 3 goes live]”, in \u0027TG Daily\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For example, a feature called \u0026quot;\u0027\u0027frecency\u0027\u0027\u0026quot; compiles the user\u0027s browing history to suggest similar websites and searches\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 April 17, Deb Richardson, quoted in Bill Scott and Theresa Neil, \u0027Designing Web Interfaces\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003d1qyJdxba6qgC ]\u0026lt;/sup\u0026gt; O’Reilly Media (2009), ISBN 978-0-596-51625-3, page 264\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the AwesomeBar will match what you’re typing (even multiple words!) against the URLs, page titles, and tags in your bookmarks and history, returning results sorted by “\u0027\u0027frecency\u0027\u0027” (an algorithm combining frequency + recency\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 August, unknown author, “Firefox 3:\u0026lt;!--colon sic--\u0026gt; A Browser Odyssey”, \u0027w:Maximum Maximum PC\u0027, Future US, ISSN 1522-4279, [http://books.google.com/books?id\u003dMtIDAAAAMBAJ\u0026amp;pg\u003dPA52\u0026amp;dq\u003dfrecency page 52\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"So the more often and the more recently you’ve been there, the higher “\u0027\u0027frecency\u0027\u0027” it has and the higher it’s rated\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 March 23, Mike Beltzner, \u0026quot;[http://groups.google.com/group/mozilla.dev.apps.firefox/msg/8a114c730c724332?q\u003dfrecency Re: Firefox privacy prefpane UI refresh]\u0026quot;, \u0026lt;tt\u0026gt;mozilla.dev.apps.firefox\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"or improve our cache performance so that we\u0027re keeping cached items that are related to sites with high \u0027\u0027frecency\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 May 20, Ron K., “[http://groups.google.com/group/mozilla.support.thunderbird/msg/760921f3b8f234ec?q\u003dfrecency Re: Address selection preference]”, \u0026lt;tt\u0026gt;mozilla.support.thunderbird\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"No, Tb [Thunderbird] has yet to develope the Fx [Firefox] \u0027\u0027frecency\u0027\u0027 thing. It\u0027s just simple pattern matching, IIUC\", \"priority\":11}]}, \"synonyms\":{}}");

