	add("frenemy", "{\"term\":\"frenemy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|friend|enemy|lang\u003den}}. Likely to have been invented independently multiple times.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who pretends to be your friend, but is really your enemy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, \u0027\u0027I Ain\u0027t No Joke,\u0027\u0027 by Eric B. and Rakim, on the album \u0026quot;Paid in Full.\u0026quot; \u0026quot;Another enemy / Not even a \u0027\u0027frenemy.\u0027\u0027\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027\u0027frenemies\u0027\u0027 —\u0027Sex and the City,\u0027 season 3 episode 16, first aired October 1. [title\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, In France the Seine has all the advantages of Northernness (a quality underrated by our Gallic \u0027\u0027frenemy\u0027\u0027) but it is too fatally interested in Paris [...] —John Lanchester, \u0027The Debt to Pleasure.\u0027 [http://print.google.com/print?id\u003d5oQTntBdq_gC\u0026amp;pg\u003dPA153\u0026amp;lpg\u003dPA153\u0026amp;sig\u003d6gozFgkZj_c0l3BG07cBvv9pCk8\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, You know when you dump a guy, only to discover years later that he\u0027s evolved into the perfect boyfriend—for the high-school \u0027\u0027frenemy\u0027\u0027 who convinced you to dump him in the first place...? —\u0027The Ex-Factor,\u0027 Andrea Semple. [back cover] [http://print.google.com/print?id\u003dPOrE5lu430EC\u0026amp;lpg\u003dPA278\u0026amp;pg\u003dPA278\u0026amp;sig\u003dQq4QqJpU6DCfifI5g-aj6w9GJo0\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, So why did we break up? Enter Blaize St. John, \u0027\u0027frenemy\u0027\u0027 extraordinaire. She came, she saw, she stole my boyfriend. —\u0027Single Girl\u0027s Guide to Murder,\u0027 Joanne Meyer. [back cover] [http://print.google.com/print?id\u003duWFlXyWSpfIC\u0026amp;pg\u003dPT4\u0026amp;lpg\u003dPT4\u0026amp;sig\u003dixqqQtxAIczgL7QnPbqldCJEy1w\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, \u0026quot;Gates made a rare and instructive appearance with his longtime \u0027\u0027frenemy\u0027\u0027 Steve Jobs.\u0026quot; Appeared on Time\u0027s June 18, 2007 issue\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A fair-weather friend who is also a rival\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"season\u003d12 number\u003d17 title\u003dSix Characters in Search of a House writer\u003dErin Ehrlich people\u003d role\u003dBill Dauterive passage\u003dSo, we\u0027re definitely \u0027not\u0027 going to be friends with Ferguson? Maybe we can be \u0027\u0027frenemies\u0027\u0027. A love-hate relationship\u0027s the next best thing\", \"priority\":9}]}, \"synonyms\":{}}");

